import React from 'react';
import styled from 'styled-components';

const ChattingLogsBlock = styled.div`
  width: 100%;
  border: 1px solid #732bff;
  flex: 7;
`;

const ChattingLogs = () => {
  return <ChattingLogsBlock></ChattingLogsBlock>;
};

export default ChattingLogs;
